import React from "react";
import { Card, Input, Tag, Select, Table, Tooltip, Button } from "antd";
//ACTIONS DE REDUX
import { crearNuevoProductoAction } from "../actions/documentosActions";
import { FullscreenExitOutlined, AudioOutlined } from "@ant-design/icons";

const Tickets = () => {

    //#region COLUMNAS TABLAS
  //FACTURAS
  const columnsTablaFactura = [
    { title: "Codigo", dataIndex: "codigo", key: "codigo" },
    { title: "Titulo", dataIndex: "titulo", key: "titulo" },
    { title: "Descripcion", dataIndex: "descripcion", key: "descripcion" },
    { title: "Categoria", dataIndex: "categoria", key: "categoria" },
    { title: "creacion", dataIndex: "creacion", key: "creacion" },
    { title: "actualizacion", dataIndex: "actualizacion", key: "actualizacion" },
    {
      title: "Accción",
      dataIndex: "",
      key: "x",
      render: (fila) => (
        <Tooltip title="Eliminar">
          <Button
            
            type="danger"
            shape="circle"
            onClick={() => seleccionarDocumento(fila)}
            icon={<DeleteOutlined />}
          />
        </Tooltip>
      ),
    },
  ];
  //#endregion


  return (
    <div className="site-card-border-less-wrapper">
    <Card
      title="Tickets"
      bordered={false}
      style={{ width: FullscreenExitOutlined }}
    >
    <Table />
      
      
    </Card>
  </div>
  );
};

export default Tickets;
